export const changeSortState = (payload) => ({type: 'changeSortState', payload});

export const changeState = (payload) => ({type: 'changeState', payload});

export const getSearchId = (payload) => ({type: 'GET_SEARCH_ID', payload})

export const getTicketsData = (payload) => ({type: "GET_TICKETS_DATA", payload});
